import React from "react";
// plugin that creates slider
import Slider from "nouislider";
// reactstrap components
import {
  Button,
  Label,
  FormGroup,
  Input,
  InputGroupAddon,
  InputGroupText,
  InputGroup,
  Container,
  Row,
  Col,
  CustomInput,
} from "reactstrap";

function Footer() {
 
  return (
    <>
        <Container style={{maxWidth:'100%',}}>
            <Row className="footerimg">
                <img
                    alt="..."
                    className="img1 img-responsive1"
                    src={require("assets/img/footer.png").default}
                    style={{ width: "100%" }}
                  />
             </Row>    
             
                <Row  className="footerrow2" xs="1" sm="2" md="4">
                  <Col className="">hi</Col>
                  <Col>hi</Col>
                  <Col>hi</Col>
                  <Col>hi</Col>
                </Row> 
                <Container>
                    <Row xs="1" sm="2" md="2">
                        <Col>hi</Col>
                        <Col>hi</Col>
                    </Row>
                </Container>   
           

        </Container>
             
      
    </>
  );
}
export default Footer;
